import React from "react";
import Header from "./components/Header";
import Page from "./components/PageSuccess";
import { Switch, Route } from "react-router-dom";
const App = () => {
  return (
   
<Switch>
     <Route exact path='/'><Header /></Route>
      <Route path='/success'><Page /></Route>
      </Switch>
       
  );
};
export default App;
